function Suggestions() {
    return (
        <div>
            {/*Suggestions content begins */}
            <h1 className="recommendations">Recommendation System</h1>
            {/* Gives a description for the recommendation system. */}
            <p className="recommendation-desc">
                We want to help improve your mental health by finding resources for you
                such as YouTube videos, websites, books, nearby events you may enjoy, or
                a safe space to talk to someone.
            </p>
        </div>
    );
}

export default Suggestions;
